import React, { useState } from 'react';


function App() {
  const [name, setName] = useState('Derek');

  function changeName () {
    setName('Loco');
  }

  return (
    <div className="App">
      Hello {name}

      <br/>
      <button onClick={changeName}> Mudar Nome</button>
    </div>
  );
}

export default App;
